import logo from './logo.svg';
import './App.css';
import Grid from '@mui/material/Unstable_Grid2';
import { TextField,Item, Button } from '@mui/material';

function App() {
  return (
    <div className="App">
          <h1>Todo List</h1>
          <Grid container spacing={2} columns={16}>
            <Grid xs={8}>
              <Item><TextField id="filled-basic" label="Todo Message" variant="filled" /></Item>
            </Grid>
            <Grid xs={4}>
              <Item><Button variant="contained">Send</Button></Item>
            </Grid>
          </Grid>
    </div>
  );
}

export default App;
